import './App.css';
import {useState,useEffect, memo} from 'react';
import axios from 'axios';

function App() {

  const [memories,setMemories]=useState([]);
  useEffect(()=>{
     axios.get("http://localhost:5000/allmemories/rahat_almas")
      .then((response)=>{
        setMemories(response.data);
        console.log(memories)
      })
  },[])

  return (
    <div className="App">
      hello world
      {
        memories.map(memory=>(
          <div>
            <h4>{memory.name}</h4>
          </div>
        ))
      }
    </div>
  );
}

export default App;
